import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faShoppingCart } from '@fortawesome/free-solid-svg-icons';
import logo from './images/LogoLoQueMastica.png'
// import logo from './logo.png';
import './css/Header.css';
import { text } from "@fortawesome/fontawesome-svg-core";

function Header(props) {
    return (
        <header className="header">
            <div className="logo-container">
                <img src={logo} alt="Logo" className="logo mr-4" />
                <h3 className="title">
                    <span className="black">LO</span>
                    <span className="red">QUE</span>
                    <span className="black">M</span>
                    <span className="red">A</span>
                    <span className="black">STICA</span>
                    <span className="red">TU</span>
                    <span className="black">M</span>
                    <span className="red">ASCOTA</span>
                </h3>
            </div>
            <div className="cart-container">
                <button className="cart-button">
                    <FontAwesomeIcon icon={faShoppingCart} className="cart-icon" />
                    <span className="cart-count">{props.cartCount}</span>
                </button>
            </div>
        </header>
    );
}

export default Header;
